import React, {useState} from "react";
import {Link} from "react-router-dom";
//import Modal from './Modal.js';
//import MobileMenu from './MobileMenu.js'

function NavBar() {

    const [showModal, setShowModal] = useState(false)
    const [showMobileMenu, setShowMobileMenu] = useState(false)

    let modal;
    let mobileMenu;

    if (showModal) {
        //modal = <Modal show={showModal} handleClose={setShowModal}/>
        console.log("Show Modal Called");
    }

    if (showMobileMenu) {
        //mobileMenu = <MobileMenu/>
        console.log("Show Mobile Menu Called");
    }

    return (
        <main>

            <div className="navbar">
                <div className="container">

                    <div className={"logo"}>
                        <Link to="/">
                            <img src={"./images/logo.png"} alt="working" width="100%" height="100%"/>
                        </Link>
                    </div>

                    {!showMobileMenu &&
                    <div className="menu-icon" onClick={() => setShowMobileMenu(!showMobileMenu)}>

                        <i className={"mobile-menu"}>

                        </i>
                    </div>
                    }

                    {showMobileMenu &&
                    <div className="menu-icon" onClick={() => setShowMobileMenu(!showMobileMenu)}>
                        <img id="mobile-exit" className="mobile-menu-exit" src={"./images/exit.svg"}
                             alt="Close Navigation"/>
                    </div>
                    }

                    <nav>

                        <ul className="primary-nav">
                            <li><Link to="/CreateUserPage" className="mobile-links">SKAPA KONTO</Link></li>
                            <li><Link to="#" className={"laptop-links mobile-links"}>ÖVNINGAR</Link></li>
                            <li className={"laptop-links mobile-links"}>
                                <Link to="/ExercisesPage">FÄRDIGA
                                    PASS
                                </Link>
                            </li>
                            <li className={"laptop-links mobile-links"}><a href="#">PROGRAM</a></li>
                        </ul>

                        <ul className="secondary-nav">
                            <li className={"mobile-links"}><input type="text" placeholder="Sök"/></li>
                            {/*<li><Link to="./LogIn">LOGGA IN</Link></li>*/}
                            <li>
                                <button type="button" className={"mobile-links"}
                                        onClick={() => setShowModal(!showModal)}>
                                    LOGGA IN
                                </button>
                            </li>

                            {!showMobileMenu &&
                            <li className="tablet-menu-icon" onClick={() => setShowMobileMenu(!showMobileMenu)}>

                                <i className={"mobile-menu"}>

                                </i>
                            </li>
                            }
                            {showMobileMenu &&
                            <li className="tablet-menu-icon" onClick={() => setShowMobileMenu(!showMobileMenu)}>
                                <img id="mobile-exit" className="tablet-menu-exit" src={"./images/exit.svg"}
                                     alt="Close Navigation"/>
                            </li>
                            }
                        </ul>

                    </nav>
                </div>
            </div>
            {modal}
            {showMobileMenu && mobileMenu}
        </main>
    );
}


export default NavBar;
